import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel, Item, Caption, Card, Col, Figure } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import tata_safari from './vehicles/tata_safari.jpeg';
import jeeto from './vehicles/mahindra_jeeto.jpeg';
import scorpio from './vehicles/mahindra_scorpio.jpeg';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'




//create classNameName for nav
class Courasel_style extends Component {

    render() {

        return (<div> 


<Card  border="red" bg="green"  className="d-block w-60 col-12 colmd-12 col-lg-12">
<Carousel>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={jeeto}
      alt="First slide"
      style={{ width: '10%' }}
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={scorpio}
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={tata_safari}
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel></Card>
        </div>
        )
    }
}

export default Courasel_style;
